import React, { Component } from "react";
import "./Footer.css";

export class Footer extends Component {
  render() {
    return (
      <div>
        <container className="container-fliud bg-danger">
          <div className="footer-logo"> 9jaDiaspora </div>
          <div className="p">
            <p>
              Author: Emmanuel 9jaDiaspora Blogger | Web-Developer | Promoter
              and sales | (c)2020 All right reserved{" "}
            </p>
          </div>
        </container>
      </div>
    );
  }
}

export default Footer;
